  \"2015-02-04T19:43:53.261549\",\n\t\"name\": \"wqi-parameter-scores-1994-2013-b0941\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Routine freshwater monitoring data collected
  by the The WA State Department of Ecology's River and Stream Monitoring Program
  are summarized by a technique called the \"Water Quality Index\" (WQI). The WQI
  ranges from 1 (poor quality) to 100 (good quality). The WQI summary does not include
  non-standard elements like metals. For temperature, pH, oxygen, and fecal coliform
  bacteria, the WQI is based on criteria in Washingtonu2019s Water Quality Standards,
  WAC 173-201A. For nutrient and sediment measures where standards are not specific,
  results are based on expected conditions in a given region. Multiple constituents
  are combined and results aggregated over time to produce a single score for each
  station and each year. All current long-term Ecology monitoring stations with at
  least 5 years data are included.  Most stations are located near the mouths of major
  streams.  These stations integrate upstream water quality and capture large basin-scale
  trends. However, status and trends at these locations may not reflect status or
  trends in any particular sub-basin. Scores for individual parameters are presented
  as Oxygen (Oxy) , pH, temperature (TEMP), total suspended sediment (TSS), turbidity(Turb),
  nitrogen(TPN), and phosphorus(TP).\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
